description:
The Beatles (No. 1) is an EP released by The Beatles in the United Kingdom on the 1 November 1963. It is the Beatles third British EP and was only released in mono; its catalogue number is Parlophone GEP 8883. Containing songs from Please Please Me, the cover was taken in the same photoshoot as the Please Please Me and 1962-1966 covers. It was also released in Argentina and New Zealand.

Track Listing [320k MP3]

    &quot;I Saw Her Standing There&quot; 

    &quot;Misery&quot; 

    &quot;Anna (Go to Him)&quot; 

    &quot;Chains&quot;
